import React from 'react';
import { Formik } from 'formik';
import { Button, Form } from 'react-bootstrap';

export default function LoginPage() {
  return (
    <>
      <link rel='stylesheet' href='login.scss'></link>
      <h1>Departure - dein Dashboard für den öffentlichen Verkehr.</h1>

      <Formik initialValues={{ email: '', password: '' }} onSubmit={console.log('test1')}>
        <Form noValidate unSubmit={console.log('test')}>
          <div className='Login'>
            <span>Login</span> <p />
            <inpu type='email' name='email' placeholder='Enter email' /> <p />
            <input type='password' name='password' placeholder='Password' /> <p />
            <Button>Login</Button>
          </div>
        </Form>
      </Formik>
    </>
  );
}
